import 'package:flutter/material.dart';

void main() {
  runApp(MyApp());
}

class MyApp extends StatelessWidget {
  @override
  Widget build(BuildContext context) {
    return MaterialApp(
      home: Scaffold(
        appBar: AppBar(
          title: Text('Table Example'),
        ),
        body: Center(
          child: Table(
            border: TableBorder.all(),
            children: [
              TableRow(
                children: [
                  TableCell(
                    child: Container(
                      color: Colors.blue,
                      child: Center(
                        child: Text('Row 1, Column 1'),
                      ),
                    ),
                  ),
                  TableCell(
                    child: Container(
                      color: Colors.green,
                      child: Center(
                        child: Text('Row 1, Column 2'),
                      ),
                    ),
                  ),
                ],
              ),
              TableRow(
                children: [
                  TableCell(
                    child: Container(
                      color: Colors.red,
                      child: Center(
                        child: Text('Row 2, Column 1'),
                      ),
                    ),
                  ),
                  TableCell(
                    child: Container(
                      color: Colors.yellow,
                      child: Center(
                        child: Text('Row 2, Column 2'),
                      ),
                    ),
                  ),
                ],
              ),
              // Add more TableRows for additional rows
            ],
          ),
        ),
      ),
    );
  }
}
